Meet the UO Summer Class ’21: Five interns from HBCUs share their on-campus essentials, future aspirations, and what lifelong lessons and values their universities have instilled in them – link in bio to hear more from them on our #UOCommunity page!

Stay tuned for a behind-the-scenes look at how they spent their time at Urban Outfitters, both inside and outside of the office, as well as more details about the limited edition clothing collaboration they got to work on as a team.

